import React from 'react';

const SearchBar = ({ questions, onSearch }) => {
  const handleSearch = (event) => {
    if (event.key === 'Enter') {
      onSearch(event.target.value);
    }
  };

  return (
    <input
      type="text"
      placeholder="Search for a question..."
      onKeyPress={handleSearch}
    />
  );
};

export default SearchBar;
